/**
 * Get internal UI SVG icon placeholder (to be filled by JS)
 */
function get_svg_icon($name, $class = '')
{
    $extra_class = $class ? ' ' . $class : '';
    return '<span class="icon' . $extra_class . '" data-icon="' . htmlspecialchars($name) . '"></span>';
}

