/* ============================================================================
   FILE ITEM
   ============================================================================ */
.item {
    display: flex;
    flex-direction: column;
    padding: var(--spacing-xs) var(--spacing-md);
    background: var(--bg-secondary);
    border: 1px solid var(--border-color);
    border-radius: var(--border-radius-sm);
    transition: var(--transition);
    cursor: pointer;
    position: relative;
}

.item:hover {
    background: var(--bg-hover);
    box-shadow: var(--shadow);
    transform: translateY(-1px);
}

/* Grid view: minimal padding and style */
.view-grid .item {
    padding: var(--spacing-md);
    border: 1px solid var(--border-color);
    background: var(--bg-primary);
    border-radius: var(--border-radius);
    height: 100%;
}

.view-grid .item:hover {
    background: var(--bg-secondary);
    border-color: var(--accent-primary);
    box-shadow: var(--shadow);
    transform: translateY(-2px);
}

/* Grid view item - Simple: Only icon + name */
.view-grid .item {
    text-align: center;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: flex-start;
    /* Align to top */
    gap: var(--spacing-md);
}

.view-grid .item-icon {
    font-size: 64px;
    line-height: 1;
    transition: var(--transition);
    margin-top: var(--spacing-sm);
    height: 100px;
    /* Reserve space for 90px thumbnail + some padding */
    display: flex;
    align-items: center;
    justify-content: center;
}

.view-grid .item:hover .item-icon {
    transform: scale(1.05);
}

.view-grid .item-content {
    width: 100%;
}

.item-thumbnail {
    object-fit: cover;
    border-radius: var(--border-radius-sm);
    vertical-align: middle;
    width: 100%;
    height: 100%;
    transition: var(--transition);
    opacity: 0;
    /* Hide until loaded */
}

.item-thumbnail.loaded {
    opacity: 1;
}

/* Hide fallback SVG icon when a thumbnail is loaded (compatible fallback for :has) */
.item-thumbnail.loaded+svg {
    display: none;
}

/* Absolute positioning to cover the icon perfectly */
.js-file-icon {
    position: relative;
    display: inline-flex;
    align-items: center;
    justify-content: center;
}

.js-file-icon .item-thumbnail {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    z-index: 2;
}

.view-grid .item-thumbnail {
    width: 90px;
    height: 90px;
    box-shadow: var(--shadow-sm);
}

.view-grid .item-name {
    display: block;
    font-weight: 500;
    font-size: 12px;
    word-break: break-word;
    line-height: 1.3;
    margin: 0;
    overflow: hidden;
    text-overflow: ellipsis;
    display: -webkit-box;
    -webkit-line-clamp: 2;
    line-clamp: 2;
    -webkit-box-orient: vertical;
}

/* Hide metadata and actions in grid view */
.view-grid .item-meta {
    display: none !important;
}

.view-grid .item-actions {
    display: none !important;
}

/* List view item */
.view-list .item {
    flex-direction: row;
    align-items: center;
    gap: var(--spacing-sm);
}

.view-list .item-icon {
    font-size: 24px;
    flex-shrink: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    width: 32px;
}

.view-list .item-thumbnail {
    width: 32px;
    height: 32px;
}

.view-list .item-content {
    flex: 1;
    min-width: 0;
    display: grid;
    grid-template-columns: 3fr 1fr 2fr 1fr;
    gap: var(--spacing-sm);
    align-items: center;
}

.view-list .item-name {
    font-weight: 500;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
    margin-bottom: 0;
}

.view-list .item-meta {
    display: contents;
}

.view-list .item-meta>* {
    font-size: 13px;
    color: var(--text-secondary);
}

/* Details view item */
.view-details .item {
    flex-direction: row;
    align-items: center;
    gap: var(--spacing-sm);
}

.view-details .item-icon {
    font-size: 24px;
    flex-shrink: 0;
}

.view-details .item-content {
    flex: 1;
    min-width: 0;
    display: grid;
    grid-template-columns: 2fr 1fr 1fr 1fr;
    gap: var(--spacing-sm);
    align-items: center;
}

.view-details .item-name {
    font-weight: 500;
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
}

.view-details .item-meta {
    display: contents;
}

.view-details .item-meta>* {
    font-size: 13px;
    color: var(--text-secondary);
}

/* Item actions */
.item-actions {
    display: flex;
    gap: var(--spacing-xs);
    margin-top: var(--spacing-sm);
}

.view-list .item-actions,
.view-details .item-actions {
    margin-top: 0;
    margin-left: auto;
}

/* Responsive List View */
@media (max-width: 768px) {
    .view-list .item-content {
        grid-template-columns: 1fr auto;
        grid-template-rows: auto auto;
        gap: var(--spacing-xs);
    }

    .view-list .item-name {
        grid-column: 1;
        grid-row: 1;
    }

    .view-list .item-meta {
        display: flex;
        flex-wrap: wrap;
        gap: var(--spacing-sm);
        grid-column: 1;
        grid-row: 2;
        min-width: 0;
    }

    .view-list .item-actions {
        grid-column: 2;
        grid-row: 1 / span 2;
        align-self: center;
        margin-left: var(--spacing-sm);
    }
}

@media (min-width: 411px) and (max-width: 768px) {
    .view-list .item-meta {
        flex-wrap: nowrap;
    }

    .view-list .item-meta>* {
        white-space: nowrap;
        overflow: hidden;
        text-overflow: ellipsis;
        min-width: 0;
    }
}

.btn-action {
    padding: var(--spacing-xs);
    border-radius: var(--border-radius-sm);
    background: var(--bg-primary);
    border: 1px solid var(--border-color);
    font-size: 16px;
    display: flex;
    align-items: center;
    justify-content: center;
    width: 32px;
    height: 32px;
}

.btn-action:hover {
    background: var(--accent-light);
    border-color: var(--accent-primary);
}

/* Empty state */
.empty-state {
    text-align: center;
    padding: var(--spacing-xl);
    color: var(--text-secondary);
}

.empty-state .icon {
    font-size: 64px;
    margin-bottom: var(--spacing-md);
    display: block;
}

/* ============================================================================
   MODAL
   ============================================================================ */
.modal {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    z-index: 1000;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: var(--spacing-lg);
}

.modal-overlay {
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background: rgba(0, 0, 0, 0.6);
    backdrop-filter: blur(4px);
}

.modal-content {
    position: relative;
    width: 100%;
    max-width: 900px;
    max-height: 90vh;
    background: var(--bg-primary);
    border-radius: var(--border-radius);
    box-shadow: var(--shadow-lg);
    display: flex;
    flex-direction: column;
}

.modal-header {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: var(--spacing-lg);
    border-bottom: 1px solid var(--border-color);
}

.modal-title {
    font-size: 18px;
    font-weight: 600;
}

.modal-close {
    font-size: 32px;
    line-height: 1;
    color: var(--text-secondary);
    padding: 0;
    width: 32px;
    height: 32px;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: var(--border-radius-sm);
}

.modal-close:hover {
    background: var(--bg-hover);
    color: var(--text-primary);
}

/* ============================================================================
   PREVIEW NAVIGATION
   ============================================================================ */
.preview-nav {
    position: absolute;
    top: 0;
    bottom: 0;
    width: 60px;
    background: transparent;
    color: rgba(255, 255, 255, 0.4);
    border: none;
    padding: 0;
    cursor: pointer;
    font-size: 40px;
    z-index: 100;
    transition: all 0.2s;
    display: flex;
    align-items: center;
    justify-content: center;
    user-select: none;
    outline: none;
    border-radius: 0;
}

.preview-nav:hover {
    background: rgba(0, 0, 0, 0.2);
    color: #fff;
}

.preview-nav.prev {
    left: 0;
}

.preview-nav.next {
    right: 0;
}

/* Responsive: slightly smaller on mobile, but still accessible */
@media (max-width: 768px) {
    .preview-nav {
        width: 40px;
        font-size: 24px;
    }
}

.modal-body {
    padding: var(--spacing-lg);
    overflow-y: auto;
    flex: 1;
}

.modal-footer {
    padding: var(--spacing-lg);
    border-top: 1px solid var(--border-color);
    display: flex;
    justify-content: flex-end;
    gap: var(--spacing-sm);
}

/* ============================================================================
   FOOTER
   ============================================================================ */
.footer {
    text-align: center;
    padding: var(--spacing-md);
    color: var(--text-secondary);
    font-size: 12px;
    border-top: 1px solid var(--border-color);
    margin-top: var(--spacing-lg);
}

/* ============================================================================
   RESPONSIVE DESIGN
   ============================================================================ */

/* Tablets */
@media (max-width: 768px) {
    body {
        padding: var(--spacing-md);
    }

    /* Header wrapping only on very small screens */
    .header-top {
        flex-direction: row;
        align-items: center;
    }

    .controls {
        width: auto;
    }

    .search-input {
        width: auto;
    }

    .stats {
        gap: var(--spacing-sm);
    }

    /* Toolbar wrapping is handled by flex-wrap: wrap in base style */

    .items.view-grid {
        grid-template-columns: repeat(auto-fill, minmax(120px, 1fr));
    }

    .view-details .item-content {
        grid-template-columns: 1fr;
    }
}

/* Small Mobiles */
@media (max-width: 480px) {
    .header-top {
        flex-direction: row;
        align-items: center;
        flex-wrap: nowrap;
        overflow-x: auto;
    }

    .controls {
        width: auto;
    }

    .search-input {
        width: 100%;
    }

    .stats {
        flex-wrap: wrap;
    }

    .toolbar-secondary {
        margin-top: var(--spacing-xs);
    }

    .toolbar {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        align-items: center;
        gap: var(--spacing-sm);
    }

    .toolbar-section {
        width: auto;
        justify-content: flex-start;
    }

    .toolbar-section--export {
        justify-content: flex-end;
    }
}

/* Mobile */
@media (max-width: 480px) {
    body {
        padding: var(--spacing-xs) var(--spacing-sm);
    }

    .title {
        font-size: 18px;
    }

    .title .icon {
        font-size: 20px;
    }

    .stats {
        display: flex;
        flex-wrap: nowrap;
        gap: var(--spacing-sm);
        padding: var(--spacing-xs) var(--spacing-sm);
        overflow-x: auto;
    }

    .toolbar-secondary {
        display: flex;
        flex-direction: column;
        align-items: stretch;
    }

    .stat-item {
        font-size: 12px;
    }

    .items.view-grid {
        grid-template-columns: repeat(auto-fill, minmax(80px, 1fr));
        gap: var(--spacing-xs);
    }

    .view-grid .item {
        padding: var(--spacing-xs);
    }

    .view-grid .item-icon {
        font-size: 40px;
    }

    .view-grid .item-name {
        font-size: 11px;
        -webkit-line-clamp: 3;
        line-clamp: 3;
    }

    .modal-content {
        max-width: 100%;
        max-height: 100vh;
        border-radius: 0;
    }

    .breadcrumb {
        font-size: 12px;
    }
}

/* ============================================================================
   UTILITIES
   ============================================================================ */
.hidden {
    display: none !important;
}

.sr-only {
    position: absolute;
    width: 1px;
    height: 1px;
    padding: 0;
    margin: -1px;
    overflow: hidden;
    clip: rect(0, 0, 0, 0);
    white-space: nowrap;
    border-width: 0;
}

kbd {
    display: inline-block;
    padding: 2px 6px;
    font-family: var(--font-mono);
    font-size: 11px;
    line-height: 1.4;
    color: var(--text-primary);
    background-color: var(--bg-secondary);
    border: 1px solid var(--border-color);
    border-radius: 3px;
    box-shadow: 0 1px 0 rgba(0, 0, 0, 0.2);
    font-weight: 600;
}

/* ============================================================================
   ICON STYLES
   ============================================================================ */
.ui-icon {
    width: 1.1em;
    height: 1.1em;
    display: inline-block;
    vertical-align: middle;
    fill: currentColor;
    flex-shrink: 0;
    line-height: 1;
}

@keyframes iconFadeIn {
    from {
        opacity: 0;
        transform: scale(0.85);
    }

    to {
        opacity: 1;
        transform: scale(1);
    }
}

/* ============================================================================
   ANIMATIONS
   ============================================================================ */
@keyframes fadeIn {
    from {
        opacity: 0;
        transform: translateY(10px);
    }

    to {
        opacity: 1;
        transform: translateY(0);
    }
}

@keyframes slideInUp {
    from {
        opacity: 0;
        transform: translateY(20px);
    }

    to {
        opacity: 1;
        transform: translateY(0);
    }
}

@keyframes slideOutDown {
    from {
        opacity: 1;
        transform: translateY(0);
    }

    to {
        opacity: 0;
        transform: translateY(20px);
    }
}

.item {
    animation: fadeIn 0.3s ease;



}

/* Share Modal */
.modal-content.share-content {
    max-width: 340px !important;
    width: 340px !important;
    min-width: 0 !important;
    flex-basis: auto !important;
}

.share-link-group {
    display: flex;
    gap: 10px;
    margin-bottom: 20px;
}

.share-link-group input {
    flex: 1;
    background: var(--bg-secondary);
    color: var(--text-primary);
    border: 1px solid var(--border-color);
    border-radius: var(--border-radius-sm);
    padding: var(--spacing-sm) var(--spacing-md);
}

.share-link-group input:focus {
    outline: none;
    border-color: var(--accent-primary);
    box-shadow: 0 0 0 3px var(--accent-light);
}

.close-btn {
    background: transparent;
    border: none;
    cursor: pointer;
    font-size: 28px;
    line-height: 1;
    color: var(--text-secondary);
    padding: 0;
    width: 32px;
    height: 32px;
    display: flex;
    align-items: center;
    justify-content: center;
    border-radius: var(--border-radius-sm);
    transition: var(--transition);
}

.close-btn:hover {
    background: var(--bg-hover);
    color: var(--text-primary);
}

#qrcode-container {
    display: flex;
    justify-content: center;
    align-items: center;
    margin: 20px auto 10px;
    padding: 10px;
    background: #fff;
    border-radius: 8px;
    width: fit-content;
}

@media (max-width: 480px) {
    .share-link-group {
        flex-direction: column;
    }
}

/* Preview Modal */
.modal-content.preview-content {
    max-width: 900px;
    width: 100%;
}

/* ============================================================================
   PRINT STYLES
   ============================================================================ */
@media print {
    body {
        background: white;
        color: black;
    }

    .controls,
    .toolbar,
    .item-actions,
    .modal,
    .footer {
        display: none !important;
    }

    .item {
        break-inside: avoid;
    }
}

