/* Hash Modal specific styles */
.hash-content {
    max-width: 600px;
}

.hash-grid {
    display: grid;
    grid-template-columns: 1fr;
    gap: var(--spacing-sm);
}

.hash-row {
    display: grid;
    grid-template-columns: 100px 1fr;
    gap: var(--spacing-sm);
    align-items: center;
}

.hash-label {
    font-weight: 600;
    color: var(--text-secondary);
    display: flex;
    align-items: center;
    justify-content: flex-end;
    gap: var(--spacing-xs);
    text-align: right;
}

.copy-hash-btn {
    background: transparent;
    border: none;
    cursor: pointer;
    padding: 2px;
    opacity: 0.3;
    transition: opacity 0.2s;
    font-size: 12px;
    display: flex;
    align-items: center;
    justify-content: center;
}

.copy-hash-btn:hover {
    opacity: 1;
}

.copy-hash-btn.copied {
    color: #4CAF50;
    opacity: 1;
}

.hash-value code {
    display: block;
    padding: var(--spacing-xs) var(--spacing-sm);
    background: var(--bg-secondary);
    border: 1px solid var(--border-color);
    border-radius: var(--border-radius-sm);
    font-family: var(--font-mono);
    font-size: 13px;
    word-break: break-all;
}

/* Readme Container */
.readme-container {
    margin-top: var(--spacing-lg);
    background: var(--bg-secondary);
    border: 1px solid var(--border-color);
    border-radius: var(--border-radius);
    overflow: hidden;
}

.readme-header {
    padding: var(--spacing-md) var(--spacing-lg);
    background: var(--bg-primary);
    border-bottom: 1px solid var(--border-color);
    font-weight: 600;
    display: flex;
    align-items: center;
    gap: var(--spacing-sm);
}

.markdown-body {
    padding: var(--spacing-lg);
    color: var(--text-primary);
    line-height: 1.6;
}

/* Markdown List Fixes */
.markdown-body ul,
.markdown-body ol {
    padding-left: 2rem;
    margin-bottom: 1rem;
}

.markdown-body li {
    margin-bottom: 0.25rem;
}

/* Other Markdown Improvements */
.markdown-body h1,
.markdown-body h2,
.markdown-body h3,
.markdown-body h4,
.markdown-body h5,
.markdown-body h6 {
    margin-top: 1.5rem;
    margin-bottom: 1rem;
    font-weight: 600;
    line-height: 1.25;
}

.markdown-body h1 {
    font-size: 2em;
    border-bottom: 1px solid var(--border-color);
    padding-bottom: 0.3em;
}

.markdown-body h2 {
    font-size: 1.5em;
    border-bottom: 1px solid var(--border-color);
    padding-bottom: 0.3em;
}

.markdown-body p {
    margin-bottom: 1rem;
}

.markdown-body code {
    padding: 0.2em 0.4em;
    margin: 0;
    font-size: 85%;
    background-color: var(--bg-primary);
    border-radius: 3px;
    font-family: var(--font-mono);
}

.markdown-body pre {
    padding: 1rem;
    overflow: auto;
    font-size: 85%;
    line-height: 1.45;
    background-color: var(--bg-primary);
    border-radius: 3px;
    margin-bottom: 1rem;
}

.markdown-body pre code {
    background-color: transparent;
    padding: 0;
}

.markdown-body blockquote {
    padding: 0 1em;
    color: var(--text-secondary);
    border-left: 0.25em solid var(--border-color);
    margin: 0 0 1rem 0;
}

/* ============================================================================
   NOTIFICATIONS
   ============================================================================ */
#notification-toast {
    position: fixed;
    bottom: 2rem;
    right: 2rem;
    display: -webkit-box;
    -webkit-line-clamp: 2;
    line-clamp: 2;
    -webkit-box-orient: vertical;
    background: var(--bg-secondary);
    color: var(--text-primary);
    padding: 1rem 1.5rem;
    border-radius: var(--border-radius);
    box-shadow: var(--shadow-lg);
    border: 1px solid var(--border-color);
    z-index: 10000;
    pointer-events: none;
    overflow: hidden;
    animation: slideInUp 0.3s ease;
}

