/* ============================================================================
   480PX RESPONSIVE FIXES
   ============================================================================ */
@media (max-width: 480px) {

    .header-top,
    .stats,
    .toolbar-section,
    .export-group,
    .controls,
    .controls-group {
        flex-wrap: nowrap !important;
        display: flex !important;
        align-items: center !important;
    }

    .header-top {
        gap: var(--spacing-xs) !important;
        justify-content: flex-start !important;
    }

    .title {
        font-size: 16px !important;
        flex-shrink: 1 !important;
        margin-bottom: 0 !important;
    }

    #header-controls {
        flex: 2 !important;
        gap: var(--spacing-xs) !important;
        justify-content: flex-end !important;
    }

    .search-input {
        min-width: 60px !important;
        flex: 1 !important;
        font-size: 12px !important;
        padding: 4px 8px !important;
    }

    .controls-group {
        gap: 2px !important;
        flex-shrink: 0 !important;
    }

    .stats {
        gap: var(--spacing-sm) !important;
        padding: 6px 8px !important;
        justify-content: flex-start !important;
    }

    .stat-item {
        font-size: 11px !important;
        white-space: nowrap !important;
        flex-shrink: 0;
    }

    .stat-item .icon {
        display: none !important;
        /* Hide stat icons on 480px to save space */
    }

    .toolbar {
        gap: var(--spacing-xs) !important;
        padding: 4px 8px !important;
        margin-bottom: 4px !important;
    }

    .toolbar-section {
        gap: var(--spacing-xs) !important;
        flex: auto !important;
        justify-content: flex-start !important;
    }

    .toolbar-label {
        font-size: 11px !important;
        /* display: none !important; /* Optional: hide labels if still too tight */
    }

    .btn,
    .select-sm,
    .btn-icon {
        padding: 4px 6px !important;
        font-size: 11px !important;
    }

    .btn .text {
        display: none !important;
        /* Hide text in buttons to save space */
    }

    /* Force show copy button text on mobile */
    #copy-list-btn .text {
        display: inline-block !important;
    }

    .select-sm {
        padding-right: 20px !important;
        max-width: 100px !important;
    }

    .export-group {
        width: 100% !important;
        justify-content: space-between !important;
    }

    #window-size-stat {
        font-size: 11px !important;
    }
}
/* Theme: cute */
/**
 * Cute Theme (Anime & Glassmorphism)
 */
[data-theme="cute"] {
    /* Background Image */
    --bg-image: url("data:image/jpg;base64,");
    --bg-attachment: fixed;

    /* Private variables for glassmorphism base colors */
    --glass-base-light: 255, 255, 255;
    --glass-base-dark: 20, 20, 30;

    /* Transparent Backgrounds for better readability */
    --bg-primary: rgba(var(--glass-base-light), 0.12);
    --bg-secondary: rgba(var(--glass-base-light), 0.10);
    --bg-tertiary: rgba(var(--glass-base-light), 0.08);
    --bg-hover: rgba(var(--glass-base-light), 0.18);
    --bg-active: rgba(var(--glass-base-light), 0.22);

    /* Text Colors - Neutral Dark for better readability */
    --text-primary: #000000;
    --text-secondary: #333333;
    --text-muted: #666666;

    --border-color: rgba(255, 255, 255, 0.15);

    /* Cute Accents (Pink/Pastel) */
    --accent-primary: #ff5c9d;
    --accent-hover: #c92969;
    --accent-light: rgba(255, 126, 179, 0.2);

    --success: #69f0ae;
    --danger: #ff5252;
    --warning: #ffd740;
    --info: #40c4ff;

    /* Shadows for depth */
    --shadow-sm: 0 2px 8px rgba(0, 0, 0, 0.05);
    --shadow: 0 4px 16px rgba(0, 0, 0, 0.1);
    --shadow-lg: 0 8px 32px rgba(0, 0, 0, 0.15);

    /* Glass Effect Props - Subtle blur for readability without hiding background */
    --backdrop-blur: blur(2px);
    --border-radius: 16px;
    --border-radius-sm: 8px;
}

/* specific tweaks for better visibility/cuteness */
body[data-theme="cute"] {
    background-color: #f3ebee;
}

body[data-theme="cute"] .title {
    color: #fff;
    text-shadow: 0 2px 4px rgba(0, 0, 0, 0.3);
}

/* Make Modals (Preview, Hash, Share) clearer/more opaque for readability */
body[data-theme="cute"] .modal-content,
body[data-theme="cute"] .readme-container {
    background: rgba(255, 255, 255, 0.5);
    border: 1px solid rgba(255, 255, 255, 0.5);
    box-shadow: 0 10px 40px rgba(0, 0, 0, 0.2);
}

body[data-theme="cute"] #notification-toast {
    background: rgba(255, 255, 255, 0.95);
    color: #440022;
    border: 1px solid rgba(255, 126, 179, 0.5);
    box-shadow: 0 8px 32px rgba(255, 126, 179, 0.3);
}

/* Add contrasting text outline (white glow) ONLY to specific elements */
body[data-theme="cute"] .item-size,
body[data-theme="cute"] .item-date,
body[data-theme="cute"] .item-type,
body[data-theme="cute"] .stats,
body[data-theme="cute"] .stat-item,
body[data-theme="cute"] .empty-state,
body[data-theme="cute"] .footer,
body[data-theme="cute"] #notification-toast {
    /* Soft white glow/shadow for readability without hard edges */
    text-shadow: 0 0 3px rgba(255, 255, 255, 0.9), 0 0 1px rgba(255, 255, 255, 0.5);
}
/* Theme: dark */
/**
 * Dark Theme (Modern Midnight Graphite)
 * Inspired by modern professional IDEs and dashboards.
 */
[data-theme="dark"] {
    --bg-primary: #0d1117;
    /* Midnight background */
    --bg-secondary: #161b22;
    /* Deep graphite */
    --bg-tertiary: #21262d;
    /* UI component background */
    --bg-hover: #21262d;
    --bg-active: #30363d;

    --text-primary: #c9d1d9;
    /* Light gray text */
    --text-secondary: #8b949e;
    /* Muted gray text */
    --text-muted: #484f58;
    /* Very muted text */

    --border-color: #30363d;

    --accent-primary: #58a6ff;
    /* GitHub Blue */
    --accent-hover: #79c0ff;
    --accent-light: rgba(88, 166, 255, 0.1);

    --success: #3fb950;
    --danger: #f85149;
    --warning: #d29922;
    --info: #58a6ff;

