         */
        loadFont(lang) {
            const fonts = {
                'vi': '&family=Be+Vietnam+Pro:wght@400;500;600;700',
                'zh': '&family=Noto+Sans+SC:wght@400;500;600;700',
                'zh-CN': '&family=Noto+Sans+SC:wght@400;500;600;700',
                'zh-TW': '&family=Noto+Sans+TC:wght@400;500;600;700',
